import React, {useState} from "react";
export default function Home (){

    const [count, setCount] = useState(0);

    return (
        <div>
            <button onClick={() => {setCount(count + 1)}}>click+</button>
            <button onClick={() => {setCount(count - 1)}}>click-</button>
            <p>{count}</p>
        </div>
    )

}
